import React from 'react';
import BotCard from './BotCard';

function BotCollection({ bots, handleDischarge, handleClick }) {
  return (
    <div className="bot-collection">
      {bots.map(bot => (
        <BotCard key={bot.id} bot={bot} handleClick={() => handleClick(bot.id)} /> // Pass bot.id to handleClick
      ))}
    </div>
  );
}

export default BotCollection;
